import logo from './logo.svg';
import './App.css';
import Kepala from './component/Kepala';
import { Navbar }  from './component/Navbar';
import Badan from './component/badan';

function App() {
  return (
    <div>
      <div className="App">
        <Kepala/>
      </div>
      <div className="navigasi">
        <Navbar/>
      </div>
      <div>
        <Badan/>
      </div>
    </div>
  );
}

export default App;
